import { NavLink } from "react-router-dom";
import styles from "./Navbar.module.css";

const Header = () => {
  return (
    <header>
      <nav>
        <img src="/img/logoPet.png" alt="Logo Pet" />

        <NavLink to="/" className={({ isActive }) => isActive ? "active" : ""}>
          Home
        </NavLink>

        <NavLink to="/adocao" className={({ isActive }) => isActive ? "active" : ""}>
          Adotar
        </NavLink>

        <NavLink to="/cadastro-pet" className={({ isActive }) => isActive ? "active" : ""}>
          Cadastrar pet
        </NavLink>

        <NavLink to="/sobre" className={({ isActive }) => isActive ? "active" : ""}>
          Sobre
        </NavLink>
      </nav>

      <div className="end">
        <button onClick={() => navigate("/login")}>
          Login/Cadastre-se
        </button>
      </div>
    </header>
  );
};

export default Header;
